import "./pages.css"
import "./portfolio.css"

const Art = () => {
    return(
        <div>
            <section className={"allInfo"}>
                <h1 className={"mainTitle portfolioTitle"}>art portfolio.</h1>
                <p className={"subTitle"}>Check out some of my best artworks</p>
            </section>
        </div>
    )
}

export default Art;
